import React, { Component } from 'react';
import { Navigate } from 'react-router-dom';

class Data extends Component{
    
    handleClick() {
        return <Navigate to="/" />
     }

    
    render() {
        return (
            <div>
                This is Data
                <button onClick={this.handleClick}/>            </div>
        )
    }
}

export default Data
